import './App.css';
import HeroImage from "./pictures/MagdaHero.jpg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { useTrail,animated } from '@react-spring/web';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowUpRightFromSquare} from '@fortawesome/free-solid-svg-icons';




function App() {
  return (
    <div>



    <Parallax pages={4}>
      <ParallaxLayer>

        <NavBar></NavBar>

      </ParallaxLayer>
      <ParallaxLayer factor={1} speed={0.5}>
        <div className=" h-screen flex justify-center items-center">
          <HeroText></HeroText>
        </div>
      </ParallaxLayer>
      <ParallaxLayer offset={0.6} speed={0.75}>
        <HeroSubText></HeroSubText>
      </ParallaxLayer>
      <ParallaxLayer className='z-10' speed={0.75} offset={0.999} factor={3}>
        <ProjectWrapper></ProjectWrapper>
      </ParallaxLayer>
      <ParallaxLayer offset={2.8} speed={0.80}>

          <AboutMe></AboutMe>

      </ParallaxLayer>
      <ParallaxLayer offset={3.4} speed={0.4}>

          <ContactMe></ContactMe>

      </ParallaxLayer>
    </Parallax>

    </div>
  );

}
function NavBar(){
      return(
        <div className='font-Nunito font-thin text-2xl '>
          <nav className="flex justify-between items-center content-center">
          <a className='m-5 text-3xl flex items-center gap-1' href='./index'> <span className=' bg-botticelli-800 rounded-full block w-2 h-2'></span>Magda Nemes</a>
            <ul className='flex gap-4 items-center'>
              <li ><a href='#About'>About</a></li>


              <li>Projects <span className="block max-w-0 group-hover:max-w-full transition-all duration-500 h-0.5 bg-buttercup-400"></span></li>
            </ul>
            <a className='mx-10' href='./'>Contact Me</a>
          </nav>
          <CreateLine></CreateLine>
        </div>
      )
